import React from 'react';
import styled from 'styled-components';

//
import image1 from '../images/the-chow-one.png'
const Instagram = () => {

    const Container = styled.div`
        display: grid;
        grid-gap: 10px;
        grid-template-columns: 100px 100px 100px;
        background-color: #fff;
        color: #444;
    `
    const ItemOne = styled.div`

        grid-column-start: 1;
        grid-column-end: 9;
        grid-row-start: 1;
        grid-row-end: 6;

    `
    const ItemTwo = styled.div`

        grid-column-start: 1;
        grid-column-end: 6;
        grid-row-start: 6;
        grid-row-end: 12;

    `
    const ItemThree = styled.div`

        grid-column-start: 6;
        grid-column-end: 9;
        grid-row-start: 6;
        grid-row-end: 9;
    `
    const ItemFour = styled.div`
    grid-column-start: 4;
    grid-column-end: 12;
    grid-row-start: 4;
    grid-row-end: 14;
    `

    return (
        <div class="wrapper">
            <div class="box a">A</div>
            <div class="box b">B</div>
            <div class="box c">C</div>
            <div class="box d">D</div>
        </div>
    )
}

export default Instagram;
